<h1 class="Section4">
<a class="Section5" href="#" id="introduction">Introduction</a>
</h1>
<div class="Section6"><br><b>Smarty</b> est un système de template web écrit en PHP, présenté comme un outil de séparation des préoccupations, destiné à simplifier la compartimentation, permettant au front-end d'une page web de changer séparément de son back-end. Idéalement, cela réduit les coûts et minimise les efforts associés à la maintenance logicielle.

Smarty génère du contenu web en plaçant des balises Smarty spéciales dans un document. Ces balises sont traitées et remplacées par un autre code. Les balises sont des directives pour Smarty qui sont délimitées par des délimiteurs de modèle. Ces directives peuvent être des variables, désignées par un signe dollar ($), des fonctions, des instructions logiques ou en boucle. Smarty permet aux programmeurs PHP de définir des fonctions personnalisées accessibles à l'aide des balises Smarty.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
